import React, { useState } from "react";
// import React from "react";
import { Nav, NavLink, NavMenu } from "./NavbarElements";
import Logo from "../Assets/Connect Pulse.png";
import { BsCart2 } from "react-icons/bs";
import { HiOutlineBars3 } from "react-icons/hi2";
import { Box, Drawer, List, ListItem, ListItemButton, ListItemIcon, ListItemText } from "@mui/material";
import HomeIcon from "@mui/icons-material/Home";
import InfoIcon from "@mui/icons-material/Info";
import CommentRoundedIcon from "@mui/icons-material/CommentRounded";
import PhoneRoundedIcon from "@mui/icons-material/PhoneRounded";
import ShoppingCartRoundedIcon from "@mui/icons-material/ShoppingCartRounded";
// import { Button } from "@mui/base";

const Navbar = () => {

    const [openMenu, setOpenMenu] = useState(false)
    const menuOptions = [
        {
            text: "Home",
            icon: <HomeIcon/>
        },
        {
            text: "Advocacy",
            icon: <InfoIcon/>
        },
        {
            text: "Research",
            icon: <CommentRoundedIcon/>
        },
        {
            text: "Contact",
            icon: <PhoneRoundedIcon/>
        },
        {
            text: "Cart",
            icon: <ShoppingCartRoundedIcon/>
        }
    ]

  return (
  <Nav>
    <div className="nav-logo-container">
        <img src={Logo} alt=""/>
    </div>
    <NavMenu className="navbar-links-container">
        <NavLink to="/" activeStyle>Home</NavLink>
        <NavLink to="/advocacy" activeStyle>Advocacy</NavLink>
        <NavLink to="/research" activeStyle>Research</NavLink>
        <NavLink to="/contact" activeStyle>Contact</NavLink>
        <NavLink to="/cart" activeStyle>
            <BsCart2 className="navbar-cart-icon"/>
        </NavLink>
        <NavLink className="primary-button" to="/contribute" activeStyle>Contribute</NavLink>

        {/* <a href="">Advocacy</a>
        <a href="">Research</a>
        <a href="">Contact</a>
        <a href="">
            <BsCart2 className="navbar-cart-icon"/>
        </a>
        <Button className="primary-button">Contribute</Button> */}

    </NavMenu>
    <div className="navbar-menu-container">
        <HiOutlineBars3 onClick={() => setOpenMenu(true)}/>
    </div>
    <Drawer open={openMenu} onClose={() => setOpenMenu(false)} anchor="right">
        <Box sx={{ width: 250}} role="presentation" onClick={() => setOpenMenu(false)} onKeyDown={() => setOpenMenu(false)}>
            <List>
                {menuOptions.map((item) => (
                    <ListItem key={item.text} disablePadding>
                        <ListItemButton>
                            <ListItemIcon>{item.icon}</ListItemIcon>
                            <ListItemText primary={item.text}/>
                        </ListItemButton>
                    </ListItem>
                ))};
            </List>
        </Box>
    </Drawer>
  </Nav>
  )
}

export default Navbar
